    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {

            return '';

            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["building_id", "registration_id", "borough", "house_number", "street_name", "postcode", "of_dwelling_units", "infested_dwelling_unit_count", "eradicated_unit_count", "re_infested_dwelling_unit", "filing_date", "filing_period_start_date", "filling_period_end_date", "latitude", "longitude", "community_board", "city_council_district", "census_tract_2010", "bin", "bbl", "nta"];

    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
